import React from 'react';
import '../css/BarraNav.css'

function BarraNav(){
    return(
        <div>
           <nav>
            <ul>
                <li><a >Home</a></li>
                <li><a >Registro</a></li>
                <li><a >Login</a></li>
            </ul>
        </nav>
        </div>
    );
}
export default BarraNav;
